export const useRentalFilter = (rentalList, filterValue) => {
  function filtered(rentalList, filterValue) {
    switch (filterValue) {
      case "1":
        return rentalList.filter(
          (rental) => !rental.isMixingComplete && !rental.isProjectComplete
        );
      case "2":
        return rentalList.filter(
          (rental) => !rental.isProjectComplete && rental.isMixingComplete
        );
      case "3":
        return rentalList.filter(
          (rental) => rental.isProjectComplete && rental.isMixingComplete
        );
      case "0":
        return rentalList;
    }
  }

  const filteredList = filtered(rentalList, filterValue);
  return filteredList;
};
